	    public String getCountryDescription(String countryCode) {
	        String countryDescription = null;

	        try  {
	        	Connection connection = DriverManager.getConnection(DB_URL, DB_USERNAME, DB_PSWD);
	             PreparedStatement preparedStatement = connection.prepareStatement(SELECT_NALTY_CODE_DESC);
	            preparedStatement.setString(1, countryCode);
	            ResultSet rs = preparedStatement.executeQuery();

	            if (rs.next()) {
	                countryDescription = rs.getString("NALTY_DESC");
	            }
	        } catch (Exception e) {
	            e.printStackTrace();
	        }
	        return countryDescription;
	    }
